import { GET_ITEMS } from "../Actions/Types";

const initialState = {
  items: [] ,
  lo
};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_ITEMS:
      return {
        ...state,
        items: action.payload
      };
    default:
      return state;
  }
}
